SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";
DROP TABLE IF EXISTS `wp_postmeta`;
CREATE TABLE IF NOT EXISTS `wp_postmeta` (`meta_id` bigint(20) unsigned NOT NULL, `post_id` bigint(20) unsigned NOT NULL DEFAULT '0',`meta_key` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,`meta_value` longtext COLLATE utf8mb4_unicode_ci) ENGINE=InnoDB AUTO_INCREMENT=105 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
TRUNCATE TABLE `wp_postmeta`;
DROP TABLE IF EXISTS `wp_posts`;
CREATE TABLE IF NOT EXISTS `wp_posts` (`ID` bigint(20) unsigned NOT NULL,`post_author` bigint(20) unsigned NOT NULL DEFAULT '0',`post_date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',`post_date_gmt` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',`post_content` longtext COLLATE utf8mb4_unicode_ci NOT NULL,`post_title` text COLLATE utf8mb4_unicode_ci NOT NULL,`post_excerpt` text COLLATE utf8mb4_unicode_ci NOT NULL,`post_status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'publish',`comment_status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'open',`ping_status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'open',`post_password` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',`post_name` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',`to_ping` text COLLATE utf8mb4_unicode_ci NOT NULL,`pinged` text COLLATE utf8mb4_unicode_ci NOT NULL,`post_modified` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',`post_modified_gmt` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',`post_content_filtered` longtext COLLATE utf8mb4_unicode_ci NOT NULL,`post_parent` bigint(20) unsigned NOT NULL DEFAULT '0',`guid` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',`menu_order` int(11) NOT NULL DEFAULT '0',`post_type` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'post',`post_mime_type` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',`comment_count` bigint(20) NOT NULL DEFAULT '0') ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
TRUNCATE TABLE `wp_posts`;
ALTER TABLE `wp_postmeta`ADD PRIMARY KEY (`meta_id`), ADD KEY `post_id` (`post_id`), ADD KEY `meta_key` (`meta_key`(191));
ALTER TABLE `wp_posts`ADD PRIMARY KEY (`ID`), ADD KEY `type_status_date` (`post_type`,`post_status`,`post_date`,`ID`), ADD KEY `post_parent` (`post_parent`), ADD KEY `post_author` (`post_author`), ADD KEY `post_name` (`post_name`(191));
ALTER TABLE `wp_postmeta`MODIFY `meta_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=105;
